import React from 'react';
import classes from './Post.module.css';


const Post = () => {
	return <div className={classes.published_posts}>
		<div className={classes.post}>
			<div className={classes.circle}></div>
			<p>post 1</p>
		</div>
	</div>

}

export default Post
